import React, { useState } from "react";

const SimpleInput = (props) => {
  const [enteredName, setEnteredName] = useState("");
  const [inputTouched, setInputTouched] = useState(false);

  const enteredNameIsValid = enteredName.trim() !== "";
  const nameInputIsInvalid = !enteredNameIsValid && inputTouched;

  let formIsValid = false;
  if (enteredNameIsValid) {
    formIsValid = true;
  }

  const nameInputClasses = nameInputIsInvalid
    ? "form-control invalid"
    : "form-control ";

  const nameInputChangeHandler = (event) => {
    setEnteredName(event.target.value);
  };

  const nameInputBlurHandler = (event) => {
    setInputTouched(true);
  };

  const formSubmitted = (e) => {
    e.preventDefault(); //prevent reloading
    setInputTouched(true);

    if (!enteredNameIsValid) {
      return;
    }
    /* eslint-disable */console.log(...oo_oo(`5f35b470_0`,enteredName));

    setEnteredName("");
    setInputTouched(false);

    /*
      const nameInputRef = useRef("");
    const enteredValue = nameInputRef.current.value;
    console.log(enteredValue);
    nameInputRef.current.value = ""; => NOT IDEAL, DON´T MANIPULATE THE DOM. Ikke riktig å bruke useref sånn for å sette input feltet tom. 
              ref={nameInputRef}
    */
  };

  return (
    <form onSubmit={formSubmitted}>
      <div className={nameInputClasses}>
        <label htmlFor="name">Your Name</label>
        <input
          type="text"
          id="name"
          onChange={nameInputChangeHandler}
          onBlur={nameInputBlurHandler}
          value={enteredName}
        />
        {nameInputIsInvalid && (
          <p className="error-text">Name must not be empty</p>
        )}
      </div>
      <div className={nameInputClasses}>
        <label htmlFor="email">Email</label>
        <input
          type="text"
          id="email"
          onChange={nameInputChangeHandler}
          onBlur={nameInputBlurHandler}
          value={enteredName}
        />
        {nameInputIsInvalid && (
          <p className="error-text">Name must not be empty</p>
        )}
      </div>
      <div className="form-actions">
        <button disabled={!formIsValid}>Submit</button>
      </div>
    </form>
  );
};

export default SimpleInput;
